import React from 'react';
import ReactDOM from 'react-dom';

const Surae = () =>
{
    function myfunction()
           {
               var a = document.getElementById("demo1").Value;
               document.getElementById("demo2").innerHTML +=`<li>`+a+`</li>` ;
           }
    return <div>
                <input id="demo1"></input>
                <button onClick={myfunction}>ADD</button><br/><br/>
                <div id="demo2"></div>
           </div>

}
ReactDOM.render(<Surae />, document.getElementById('root'));
